import './App.css';
import {Router,Route} from 'react-router-dom';
import Navbar from './Components/Navbar/Navbar';
import Home from './Components/Home/Home';

function App() {
  return (
    <div className="App">
     <Navbar/>

    <main>
      <Routes>
        <Route path = '/' element= {<Home/>}/>
        <Route path = '/about' element= {<Home/>}/>

      </Routes>
    </main>




    </div>
  );
}

export default App;
